styles:
.jump-input {
  height: 17px;
  width: 50px;
  min-width: 30px;
}

input[type=number] {
  border: solid 1px #ccc;
  margin-left: 10px;
  border-radius: 2px;
  height: 22px;
  ime-mode: Disabled;
  -moz-appearance: textfield;
}

input[type=number]::-webkit-outer-spin-button,
input[type=number]::-webkit-inner-spin-button {
  -webkit-appearance: none !important;
  margin: 0;
}

.select-box {
  display: flex;
  justify-content: center;
}

.selet {
  color: #0081cc !important;
  background-color: #edf0f5;
  width: 24px;
  height: 24px;
  border-radius: 2px;
}

.number {
  width: auto;
  height: 24px;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 14px;
  color: #666666;
  padding: 0 8px;
}

.left {
  width: 24px;
  height: 24px
}

.right {
  width: 24px;
  height: 24px
}

.left .img:hover, .right .img:hover {
  border: 0px;
  background-color: rgba(237, 240, 245, 0.7);
}

.right .img {
  width: 24px;
  height: 24px;
  background: url("data:image/png;base64,") no-repeat center;
  border: solid 1px rgba(204, 204, 204, 0.5);
}

.left .img {
  width: 24px;
  height: 24px;
  background: url("data:image/png;base64,") no-repeat center;
  border: solid 1px rgba(204, 204, 204, 0.5);
}
